import React, { useState } from 'react'
import Todolist from './Todolist'

const Todo = () => {
    let [todo ,setTodo]=useState("")
    let handeleSubmit=(e)=>{
        e.preventDefault()
        setItem((preVal)=>{
            return[...preVal ,todo]
        })
        setTodo('')
    }
    let getInputVal =(e)=>{
        setTodo(e.target.value)
    }

  return (
    <div>
        <h1>Todo list</h1>
        <form action="" onSubmit={handeleSubmit}>
            <input type="text" onChange={getInputVal} value={todo} />
            <button type='button' className='btn btn'>Add TODO</button>
        </form>
        {
            setItem.map((item ,i)=>{
                return <Todolist 
                key={i+1}
                item={item}
                index={i}
                setItem={setItem}
                />
            })
        }
      
    </div>
  )
}

export default Todo
